مەۋلان مۇھەممەت تاتلىق</p>
<p>مەۋلان مۇھەممەت تاتلىق 1980 ـ يىلى ئۈرۈمچىدە تۇغۇلغان.</p>
<p>شىنجاڭ مالىيە ئىقتىساد ئىنستىتۇتىنىڭ ئۇچۇر باشقۇرۇش كەسىپىنى پۇتۇرگەن</p></text></body></html>
